gymDs <- read_csv("megaGymDataset.csv")

#head(gymDs, 5)
#names(gymDs)

ds <- gymDs %>%
  mutate(ID = ...1,
         Level = factor(Level, levels = c("Beginner", "Intermediate", "Expert")),
         Type = as.factor(Type)) %>%
  select(-...1) %>% 
  drop_na() 
